DECLARE
  CURSOR CUR_Beneficiario IS
      SELECT B.ROWID IDT
            ,PE.FEC_ENTREGA_SIMCARD
        FROM <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB") ?> PE
   LEFT JOIN  <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB") ?> UM
               ON PE.NUM_DOC =  (CASE WHEN UM.SK_CATEG_BENEF = 1 
                                      THEN UM.NUM_IDENT_MENOR 
                                 ELSE UM.NUM_DOC 
                                 END)
  LEFT JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> B
               ON PE.NUM_DOC = B.NUM_DOC
              AND (CASE WHEN UM.SK_CATEG_BENEF = 1 
                        THEN UM.NUM_IDENT_MENOR 
                   ELSE UM.NUM_DOC 
                   END) =B.NUM_DOC
              AND PE.MIN = B.MIN
      WHERE UM.BAN_ESTADO_REG=3
      AND FEC_ENTREGA_SIM_CARD = '01/01/1900';


  v_Nro_Registros     PLS_INTEGER;
BEGIN
  v_Nro_Registros := 1;
  FOR Datos IN CUR_Beneficiario LOOP
      UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?>
         SET  FEC_ENTREGA_SIM_CARD = Datos.FEC_ENTREGA_SIMCARD                  
       WHERE ROWID = Datos.IDT    
      ;
      v_Nro_Registros := v_Nro_Registros + 1;

      IF MOD (v_Nro_Registros, 5000) =  0 THEN
        COMMIT;
      END IF;
   -- END IF;
  END LOOP;
  COMMIT;
END;

DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_ACTUALIZA IS
        SELECT
             REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(EMAIL_MENOR,'/',' '),'<',' '),'>',' '),' ',''),',','.') AS EMAIL_MENORS
            ,REPLACE(REPLACE(REPLACE(REPLACE(REPLACE(EMAIL,'/',' '),'<',' '),'>',' '),' ',''),',','.') AS EMAILS
            ,NUM_DOC
            ,NUM_IDENT_MENOR
        FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB") ?>
        WHERE REGEXP_LIKE(EMAIL_MENOR, '*[/<>, ]')
        OR REGEXP_LIKE(EMAIL, '*[/<>,] ');

    v_Reg_Actualiza            CUR_ACTUALIZA%ROWTYPE;
    v_Nro_Actualiza            PLS_Integer; 

BEGIN

   OPEN CUR_ACTUALIZA;
   v_Nro_Actualiza := 0;

  LOOP
    FETCH CUR_ACTUALIZA INTO v_Reg_Actualiza;
    EXIT WHEN CUR_ACTUALIZA%NOTFOUND;
    BEGIN  
        IF v_Reg_Actualiza.NUM_DOC IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB") ?> T1
               SET T1.EMAIL = v_Reg_Actualiza.EMAILS
                  ,T1.EMAIL_MENOR = v_Reg_Actualiza.EMAIL_MENORS
             WHERE T1.NUM_DOC||'-'||T1.NUM_IDENT_MENOR = v_Reg_Actualiza.NUM_DOC||'-'||v_Reg_Actualiza.NUM_IDENT_MENOR;
        END IF;
    END;
    END LOOP; 
  CLOSE  CUR_ACTUALIZA;   
  COMMIT;
END;

BEGIN
    UPDATE <?=odiRef.getObjectName("MINTIC_MAESTRAS_TB") ?>
    SET BAN_CONSULTA = 0 
    WHERE BAN_CONSULTA = 1;
    COMMIT;
END;

