DECLARE
CONST_Num_Estado_Milla CONSTANT NUMBER (1) := 3; CONST_Num_Estado_Inicial CONSTANT VARCHAR2 (10) := '5,8'; CONST_Num_Estado_Llamada CONSTANT NUMBER (1) := 1;
CURSOR CUR_Legalizacion IS SELECT BENEFICIARIO.MIN MIN FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB") ?> MILLA JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> BENEFICIARIO ON (CASE WHEN MILLA.SK_CATEG_BENEF = 1 THEN MILLA.NUM_IDENT_MENOR ELSE MILLA.NUM_DOC END) = BENEFICIARIO.NUM_DOC LEFT JOIN <?=odiRef.getObjectName("MINTIC_LEGALIZACION_TB") ?> LEGA ON (BENEFICIARIO.MIN = LEGA.MIN) WHERE MILLA.BAN_ESTADO_REG = CONST_Num_Estado_Milla--3 AND BENEFICIARIO.SK_ESTADO_BENEFI IN (5,8)--(CONST_Num_Estado_Inicial) AND LEGA.MIN IS NULL;--5;
BEGIN
FOR Datos IN CUR_Legalizacion LOOP INSERT INTO <?=odiRef.getObjectName("MINTIC_LEGALIZACION_TB") ?> ( MIN ,ESTADO_LEGALIZA ,FEC_LEGALIZACION ,CAUSAL_LEGALIZA ,FEC_CARGA_MIN ,CANAL_REGISTRO) VALUES ( Datos.MIN ,'Aprobado' ,SYSDATE ,'La Información Enviada por Umbrella y Negocio Viene Aprobada por el Interventor' ,SYSDATE ,'NEGOCIO');
END LOOP; COMMIT; END;

DECLARE

CONST_Num_Estado_Milla                      CONSTANT NUMBER (1)   := 3;
CONST_Num_Estado_Inicial                    CONSTANT NUMBER (1)   := 5;
CONST_Num_Estado_Env_Logistica              CONSTANT NUMBER (1)   := 8;

CURSOR CUR_Ultima_Milla IS

    SELECT BENEFICIARIO.NUM_DOC NUM_DOC
     FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB") ?> MILLA
     JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> BENEFICIARIO
     ON (CASE WHEN MILLA.SK_CATEG_BENEF = 1 THEN MILLA.NUM_IDENT_MENOR ELSE MILLA.NUM_DOC END = BENEFICIARIO.NUM_DOC)
     JOIN <?=odiRef.getObjectName("MINTIC_LEGALIZACION_TB") ?> LEGALIZACION
     ON BENEFICIARIO.MIN = LEGALIZACION.MIN
     AND MILLA.MIN = LEGALIZACION.MIN
    WHERE BAN_ESTADO_REG = CONST_Num_Estado_Milla--3
    AND BENEFICIARIO.SK_ESTADO_BENEFI= CONST_Num_Estado_Inicial--5
    AND LEGALIZACION.CANAL_REGISTRO='NEGOCIO'
    ; 
BEGIN

    FOR Datos IN CUR_Ultima_Milla 
         LOOP
           UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?>
            SET SK_ESTADO_BENEFI = CONST_Num_Estado_Env_Logistica
            WHERE NUM_DOC = Datos.NUM_DOC;
    COMMIT;
        END LOOP;

END;

DECLARE

err_msg    VARCHAR2(255);

  CURSOR CUR_ACTUALIZA IS
        SELECT
             ROW_NUMBER() OVER (ORDER BY FECHA_ESTADO) AS NUM_CONSECUTIVO
            ,ROW_NUMBER() OVER (PARTITION BY T3.SK_ETAPA ORDER BY FECHA_ESTADO)||'-'||T3.SK_ETAPA AS BAN_ARCH_ACTIV
            ,T2.MIN
        FROM <?=odiRef.getObjectName("MINTIC_INFO_BASE_BENEFI_TB") ?> T3 
        JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> T2
        ON ((CASE WHEN T3.SK_CATEG_BENEF = 1 THEN T3.NUM_IDENT_MENOR ELSE T3.NUM_DOC END) = T2.NUM_DOC AND T2.MIN = T3.MIN)
        JOIN <?=odiRef.getObjectName("MINTIC_ACTIVACIONES_TB") ?> T1
        ON (T1.CODMIN = T2.MIN AND T1.CODMIN = T3.MIN)     
          ;

    v_Reg_Actualiza            CUR_ACTUALIZA%ROWTYPE;
    v_Nro_Actualiza            PLS_Integer; 

BEGIN

   OPEN CUR_ACTUALIZA;
   v_Nro_Actualiza := 0;

  LOOP
    FETCH CUR_ACTUALIZA INTO v_Reg_Actualiza;
    EXIT WHEN CUR_ACTUALIZA%NOTFOUND;
    BEGIN  
        IF v_Reg_Actualiza.MIN IS NOT NULL THEN
            UPDATE <?=odiRef.getObjectName("MINTIC_ACTIVACIONES_TB") ?> T1
               SET T1.NUM_CONSECUTIVO = v_Reg_Actualiza.NUM_CONSECUTIVO
                  ,T1.BAN_ARCH_ACTIV = v_Reg_Actualiza.BAN_ARCH_ACTIV
             WHERE T1.CODMIN = v_Reg_Actualiza.MIN;
        END IF;
        v_Nro_Actualiza := v_Nro_Actualiza  + 1;

        IF MOD (v_Nro_Actualiza, 5000) =  0 THEN
        COMMIT;
     END IF;
    END;
    END LOOP; 
  CLOSE  CUR_ACTUALIZA;   
  COMMIT;
END;

