DECLARE
CURSOR CUR_estados IS SELECT T1.NUM_DOC ,T2.MIN FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> T1 JOIN <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB") ?> T2 ON (T1.NUM_DOC = T2.NUM_DOC AND T1.MIN = T2.MIN) WHERE SK_ESTADO_BENEFI = 2 ;
BEGIN
FOR Datos IN CUR_estados LOOP DELETE FROM <?=odiRef.getObjectName("MINTIC_INFO_PLAN_ENTREGA_TB") ?> T1 WHERE T1.NUM_DOC = Datos.NUM_DOC AND MIN = Datos.MIN;
END LOOP; COMMIT; END;

DECLARE
CURSOR CUR_estados IS SELECT T1.NUM_DOC ,T1.MIN FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> T1 JOIN <?=odiRef.getObjectName("MINTIC_ACTIVACIONES_TB") ?> T2 ON (T1.MIN = T2.CODMIN) WHERE T1.SK_ESTADO_BENEFI = 2 ;
BEGIN
FOR Datos IN CUR_estados LOOP DELETE FROM <?=odiRef.getObjectName("MINTIC_ACTIVACIONES_TB") ?> T1 WHERE T1.CODMIN = Datos.MIN;
END LOOP; COMMIT; END;

DECLARE

CONST_Num_Estado_Suspendido         CONSTANT NUMBER (1)   := 3;

CONST_Num_Estado_Activo                     CONSTANT NUMBER (2)   := 1;---1 Se actualiza valor para validacion Tickler;
CONST_Num_Estado_Desactivo                  CONSTANT NUMBER (1)   := 2;
CONST_Num_Estado_Sin_Reem                   CONSTANT NUMBER (1)   := 9;

CURSOR CUR_Estados IS
        SELECT 
        DISTINCT 
            BENEFICIARIO.ROWID AS ROW_ID
            , HIST.NUM_DOC
            , HIST.FECHA_ESTADO FECHA_SUSPENDIDO
            , HIST.SK_ESTADO_BENEFI ESTADO_SUSPENDIDO
            , BENEFICIARIO.FECHA_ESTADO FECHA_ESTADO
            , BENEFICIARIO.SK_ESTADO_BENEFI
        FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_HIST") ?> HIST
        INNER JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> BENEFICIARIO
            ON HIST.NUM_DOC = BENEFICIARIO.NUM_DOC
        WHERE HIST.SK_ESTADO_BENEFI = CONST_Num_Estado_Suspendido--3
        AND BENEFICIARIO.SK_ESTADO_BENEFI IN(CONST_Num_Estado_Activo,CONST_Num_Estado_Desactivo,CONST_Num_Estado_Sin_Reem)--IN(1,2,9)
        AND BENEFICIARIO.FECHA_ESTADO >=  HIST.FECHA_ESTADO
        AND BENEFICIARIO.DIAS_SUSPENSION IS NULL;

v_fecha_suspension      DATE;
v_fecha_estado          DATE; 
v_dias_suspension       NUMBER(12);

BEGIN
    FOR Datos IN CUR_Estados 
        LOOP
        v_fecha_suspension :=Datos.FECHA_SUSPENDIDO;
        v_fecha_estado     :=Datos.FECHA_ESTADO;
        v_dias_suspension  :=v_fecha_estado-v_fecha_suspension;

            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?>
            SET DIAS_SUSPENSION = v_dias_suspension
            ,fecha_estado = SYSDATE
            WHERE NUM_DOC = Datos.NUM_DOC;
        COMMIT;
        END LOOP;

END;

DECLARE

CONST_Num_Estado_Suspendido         CONSTANT NUMBER (1)   := 3;

CONST_Num_Estado_Activo                     CONSTANT NUMBER (2)   := 1;---1 Se actualiza valor para validacion Tickler;
CONST_Num_Estado_Desactivo                  CONSTANT NUMBER (1)   := 2;
CONST_Num_Estado_Sin_Reem                   CONSTANT NUMBER (1)   := 9;

CURSOR CUR_Estados IS
          SELECT 
        DISTINCT 
            BENEFICIARIO.ROWID AS ROW_ID
            , HIST.NUM_DOC
            , HIST.FECHA_ESTADO FECHA_SUSPENDIDO
            , HIST.SK_ESTADO_BENEFI ESTADO_SUSPENDIDO
            , BENEFICIARIO.FECHA_ESTADO FECHA_ESTADO
            , BENEFICIARIO.SK_ESTADO_BENEFI
        FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB_HIST") ?> HIST
        INNER JOIN <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> BENEFICIARIO
            ON HIST.NUM_DOC = BENEFICIARIO.NUM_DOC
        WHERE HIST.SK_ESTADO_BENEFI = CONST_Num_Estado_Sin_Reem
        AND BENEFICIARIO.SK_ESTADO_BENEFI IN(CONST_Num_Estado_Desactivo)
        AND BENEFICIARIO.FECHA_ESTADO >=  HIST.FECHA_ESTADO
        AND BENEFICIARIO.DIAS_SUSPENSION IS NULL;

v_fecha_suspension      DATE;
v_fecha_estado          DATE; 
v_dias_suspension       NUMBER(12);

BEGIN
 ---EXECUTE immediate  'ALTER SESSION SET NLS_DATE_FORMAT=''dd/mm/yyyy''';
    FOR Datos IN CUR_Estados 
        LOOP
        v_fecha_suspension :=Datos.FECHA_SUSPENDIDO;
        v_fecha_estado     :=Datos.FECHA_ESTADO;
        v_dias_suspension  :=v_fecha_estado-v_fecha_suspension;

            UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?>
            SET DIAS_SUSPENSION = v_dias_suspension
            ,FECHA_ESTADO = SYSDATE
            WHERE ROWID = Datos.ROW_ID;

        END LOOP;
      COMMIT;
   EXCEPTION WHEN OTHERS THEN
    NULL;
END;

DECLARE
CONST_Num_Estado_Activo                     CONSTANT NUMBER (2)   := 1;


CURSOR CuR_Dias_Suspension IS
     SELECT MINTIC.NUM_DOC 
        FROM <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?> MINTIC
        WHERE MINTIC.DIAS_SUSPENSION IS NOT NULL
        AND MINTIC.SK_ESTADO_BENEFI= CONST_Num_Estado_Activo;

BEGIN
    FOR Datos IN CuR_Dias_Suspension 
         LOOP
           UPDATE <?=odiRef.getObjectName("MINTIC_INFO_DUPLAS_TB") ?>
            SET DIAS_SUSPENSION = 0
            ,FECHA_ESTADO = SYSDATE
            WHERE NUM_DOC = Datos.NUM_DOC;

    END LOOP;
COMMIT;
END;

